import React, { useState } from 'react';
import api from '../services/api';

export default function AuthModal({ open, onClose, onSuccess }) {
  const [tab, setTab] = useState('login');
  const [name, setName] = useState('');
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState('');

  if (!open) return null;

  const reset = () => {
    setName(''); setEmail(''); setPassword(''); setError('');
  }

  const handleSubmit = async (e) => {
    e.preventDefault();
    setLoading(true); setError('');
    try {
      if (tab === 'register') {
        const { data } = await api.post('/auth/register', { name, email, password });
        localStorage.setItem('token', data.token);
        localStorage.setItem('user', JSON.stringify({ _id: data._id, name: data.name, email: data.email }));
        onSuccess({ _id: data._id, name: data.name, email: data.email });
        reset(); onClose();
      } else {
        const { data } = await api.post('/auth/login', { email, password });
        localStorage.setItem('token', data.token);
        localStorage.setItem('user', JSON.stringify({ _id: data._id, name: data.name, email: data.email }));
        onSuccess({ _id: data._id, name: data.name, email: data.email });
        reset(); onClose();
      }
    } catch (err) {
      setError(err?.response?.data?.error || 'Something went wrong');
    } finally {
      setLoading(false);
    }
  };

  return (
    <div className="modal-backdrop" onClick={onClose}>
      <div className="modal" onClick={(e) => e.stopPropagation()}>
        <div className="tabs">
          <div className={`tab ${tab==='login'?'active':''}`} onClick={() => setTab('login')}>Login</div>
          <div className={`tab ${tab==='register'?'active':''}`} onClick={() => setTab('register')}>Register</div>
        </div>
        <form onSubmit={handleSubmit} className="card" style={{ background: 'transparent', border: 'none', padding: 0 }}>
          {tab === 'register' && (
            <div style={{ marginBottom: 10 }}>
              <label className="section-title">Name</label>
              <input className="input" value={name} onChange={(e)=>setName(e.target.value)} required />
            </div>
          )}
          <div style={{ marginBottom: 10 }}>
            <label className="section-title">Email</label>
            <input type="email" className="input" value={email} onChange={(e)=>setEmail(e.target.value)} required />
          </div>
          <div style={{ marginBottom: 10 }}>
            <label className="section-title">Password</label>
            <input type="password" className="input" value={password} onChange={(e)=>setPassword(e.target.value)} required />
          </div>
          {error && <div className="muted" style={{ color: 'tomato' }}>{error}</div>}
          <div className="row" style={{ justifyContent: 'flex-end' }}>
            <button type="button" className="button ghost" onClick={onClose}>Cancel</button>
            <button disabled={loading} className="button" type="submit">{loading? 'Please wait...' : (tab==='login'?'Login':'Register')}</button>
          </div>
        </form>
      </div>
    </div>
  );
}
